import React from 'react';
import { useState } from 'react';
import { useEffect } from 'react';
import { firebaseDb } from '../../config/firebase';
import { Card, CardHeader, CardAction, CardContent, Button, makeStyles, Typography, CardMedia } from "@material-ui/core"
import './VideoPost.css'

const VideoPost = (props) => {

    let videoUrl = props.photoObj.url;
    let [user, setUser] = useState("");
    useEffect(async () => {
        let userId = props.photoObj.uid;
        let docRef = await firebaseDb.collection('users').doc(userId).get();
        let userPostCreated = docRef.data();
        console.log(user)
        setUser(userPostCreated);
    }, [])


    return (
        <Card>
            <CardHeader>
                <CardMedia>

                </CardMedia>
            </CardHeader>
            <div className="video-container">
                <Video src={videoUrl}></Video>
            </div>
        </Card>
    );
}

function Video(props) {
    return (
        <video className="video-styles" controls muted={true} id={props.id} loop={true}>
            <source src={props.src} type="video/mp4"></source>
        </video>
    )
}

export default VideoPost;
